import { useParams } from 'react-router-dom'
import Navbar from './navbar'
import { Container,Image } from 'react-bootstrap';
// import image from '../../public/images/australia.png'
// import Content from './content'
// import { CardContent } from './data'


function Details({data}){
    const params = useParams();
    // const data = CardContent() 
    return(
        <>
            <Navbar />
            {data.filter((list) => list.id == params.id).map((list) => (
            <Container className='p-5' >
                <div>
                    <h1 className='fw-semibold'>{list.tittle}</h1>
                    <span className='text-secondary'>{list.city}</span>
                </div>
                <div className='d-flex gap-3 flex-wrap pt-5'>
                    <Image className='w-100' style={{height:'400px', objectFit:'cover'}}  src="../../images/australia.png" alt='gambar' rounded/>
                    <Image rounded style={{height:'175px', objectFit:'cover'}} src="../../images/australia.png" width="397px"  alt='gambar'/>
                    <Image rounded style={{height:'175px', objectFit:'cover'}} src="../../images/australia.png" width="397px"  alt='gambar'/>
                    <Image rounded style={{height:'175px', objectFit:'cover'}} src="../../images/australia.png" width="397px" alt='gambar'/>
                </div>
                <h6>Information Trip</h6>
            </Container>
            ))}


        </>
    )
}

export default Details
